int main()
{
    ll T;
    scanfll(T);
    ll n;
    double expect;
    ll small,big;
    ll a[100005],b[100005];
    while(T--)
    {
        scanfll(n);
        FORLL(i,0,n-1) scanfll(a[i]);
        FORLL(i,0,n-1) scanfll(b[i]);
        expect=1.*(a[n-1]+b[n-1])/2;
        for(ll i=n-2;i>=0;i--)
        {
            small=Min(a[i],b[i]);
            big=a[i]+b[i]-small;
            if(expect>=big) expect=1.*(a[i]+b[i])/2;
            else if(expect<=small) ;
            else expect=1.*small/2+expect/2;
        }
        printf("%lf\n",expect);
    }
    return 0;
}

