#include<stdio.h>
int a[1000005],b[1000005];
double qw[1000005],qw_min[1000005];
void run()
{
	int n,i,l=0,is;
	double aw=0,min=9999999;
	scanf("%d",&n);

	for(i=1;i<=n;i++)
	{
		scanf("%d",&a[i]);
	}
	for(i=1;i<=n;i++)
	{
		scanf("%d",&b[i]);
		qw[i]=(a[i]+b[i])/2;
	}

	for(i=n;i>1;i--)
	{
		if(qw[i]<min) min=qw[i];
		qw_min[i]=min;
	}

	for(i=1;i<=n;i++)
	{
		if(i==n)
		{
			aw=aw*l/(l+1)+a[i]/(l+1);
            if(a[i]!=b[i]) aw=aw*l/(l+1)+b[i]/(l+1); 
            break;
		}

		is=1;
		if(a[i]<=qw_min[i+1])
		{
			if(l!=0) aw=aw*l/(l+1)+a[i]/(l+1);
			else aw=a[i];
			l++;
		}else is=0;		

        if(a[i]!=b[i])
		{
			if(b[i]<=qw_min[i+1])
			{
				if(l!=0) aw=aw*l/(l+1)+b[i]/(l+1);
				else aw=b[i];
				l++;
			}else is=0;
		}

		if(is) break;
	}
	printf("%.4lf\n",aw);
}
int main()
{
	int T;
    scanf("%d",&T);
    while(T--) run();
}

