#include<stdio.h>
#define min(a, b) a < b ? a : b
int a[100005];
int b[100005];
int main() {
  int t;
  scanf("%d", &t);
  int n;
  while (t--) {
    scanf("%d", &n);
    for (int i = 0; i < n; i++) scanf("%d", a + i);
    for (int i = 0; i < n; i++) scanf("%d", b + i);
    double ans = 9999999999;
    double expec[3];
    for (int i = n - 1; i >= 0; i--) {
      expec[0] = (a[i] + b[i]) / 2.0L;
      expec[1] = a[i] * 0.5L + ans * 0.5L;
      expec[2] = b[i] * 0.5L + ans * 0.5L;
      for (int j = 0; j < 3; j++) ans = min(ans, expec[j]);
    }
    printf("%f\n", ans);
  }
  return 0;
}
